import React from 'react';
import styled from 'styled-components'

const Footerwrapper = styled.footer `
  background: var(--mainDarkblue);
  margin: -0.5rem;
  margin-top: -1rem;


  p {
    color: var(--mainWhite);
    font-family: 'Montserrat', sans-serif;
    margin-left: 3.5%;
  }
  h1 {
    color: var(--mainRed);
    font-size: 120%;
    font-family: 'Montserrat', sans-serif;
    margin-left: 3.5%;
  }

  .container-1 {
    height: 8rem;
  }
  .container-2 {
    height: 8rem;
  }
  .container-3 {
    height: 8rem;
  }



`

function Footer() {
  return (
        <Footerwrapper> 
          <div className = "container-1">
          <p>
            Årskurs
          </p>
          <h1>1</h1>
          </div>
          <div className = "container-2">
          <p>
            Årskurs
          </p>
          <h1>2</h1>
          </div>
          <div className = "container-3">
          <p>
            Årskurs
          </p>
          <h1>3</h1>
          </div>
        </Footerwrapper>
  );
}

export default Footer;
